import React, {Component} from 'react';
export default class Category extends Component {
    render() {
      let onClickCategoryExtend = (e) => {
        document.getElementById('Category-sub-1').style.display = 'flex';
        document.getElementById('Category-main-button-1').style.display = 'none';
        }
  
      let onClickCategoryShort = (e) => {
        document.getElementById('Category-sub-1').style.display = 'none';
        document.getElementById('Category-main-button-1').style.display = 'block';
      }
      var category = null;
      if(this.props.Category.subCategory!==undefined) {
        category = 
          <div className="Category">
            <div id="Category-main-1" className="Category-main">
            <button id="Category-main-button-1" className="Category-button" onClick={onClickCategoryExtend}>▼</button>
              <div className="Category-content">Category</div>
            </div>
            <div id="Category-sub-1" className="Category-sub">
            <button id="" className="Category-button" onClick={onClickCategoryShort}>▲</button>
               <div className="Category-content">Category</div>
            </div>
           
          </div> 
      }
  
      return(
        <li className="Nav-category-item">
          {category}
        </li>
      )
    }
  }
